        private int IdentifyPattern(Tile[] tiles)
        {
            int[] pos = new int[5];
            int ind = 0;
            for (int i = 0; i < 36; i++)
            {
                if (tiles[i] == Tile.Blocked)
                {
                    pos[ind++] = i;
                    if (ind > 5)
                    {
                        return -1;
                    }
                }
            }

            for (int i = 0; i < fhs_sheet_patterns.Length; i++)
            {
                if (pos.SequenceEqual(fhs_sheet_patterns[i]))
                {
                    return i;
                }
            }
            return -1;
        }


        public int[] getFoxLocations(Tile[] tiles, int[] perfectFauxHollowsSolution)
        {


            var locations = new int[36];

            int pattern_id = IdentifyPattern(tiles);

            if (pattern_id == -1)
            {
                return locations;
            }

            var pattern = fox_location_patterns[pattern_id];


            for (int k = 0; k < pattern.GetLength(0); k++)
            {

                for (int i = 0; i < 6; i++)
                {
                    for (int j = 0; j < 6; j++)
                    {
                        var tile = tiles[i * 6 + j];
                        var solution = perfectFauxHollowsSolution[i * 6 + j];

                        if (tile == Tile.Empty)
                        {
                            if (pattern[k, i, j] != 0 && pattern[k, i, j] != 4 && pattern[k, i, j] != 5)
                            {
                                goto exit_loop;
                            }
                        }
                        else if (Tile.Swords.HasFlag(tile) || solution == PerfectFauxHollows.ConfirmedSword)
                        {
                            if (pattern[k, i, j] != 3)
                            {
                                goto exit_loop;
                            }
                        }
                        else if (Tile.BoxChest.HasFlag(tile) || solution == PerfectFauxHollows.ConfirmedChest || solution == PerfectFauxHollows.ConfirmedBox)
                        {
                            if (pattern[k, i, j] != 2)
                            {
                                goto exit_loop;
                            }
                        }
                        else if (tile == Tile.Commander)
                        {
                            return locations;
                        }
                    }

                }

                for (int i = 0; i < 6; i++)
                {
                    for (int j = 0; j < 6; j++)
                    {
                        if (pattern[k, i, j] == 4 || pattern[k, i, j] == 5)
                        {
                            locations[i * 6 + j]++;
                        }
                    }
                }
            exit_loop: { }

            }



            return locations;
        }


    }

